export { AdminStats } from "./AdminStats";
export { QuickStats } from "./QuickStats";
export { SalesStats } from "./SalesStats";
export { CustomerStats } from "./AdminStats/CustomerStats";
export { IncomeStats } from "./AdminStats/IncomeStats";
export {
  SalesByCategory,
  SalesByProduct,
  SalesBySalon,
} from "./AdminStats/SalesReport";
export { StaffServices } from "./AdminStats/StaffsAndServices";
export { CustomerByCountry } from "./AdminStats/AdminReport/CustomerByCountry";
export { InvoicesStats } from "./AdminStats/AdminReport/InvoicesStats";
export { Logs } from "./AdminStats/AdminReport/Logs";
// export { IncomeStats } from './SalesStats/IncomeStats'
// export { Statistics } from './SalesStats/Statistics'
export {
  NewQuickStats,
  NewQuickChart,
  NewQuickTopSale,
  NewStaffStats,
} from "./AdminStats/NewDashboard";
